description:
Charismatic District Attorney Monique Lamont and Detective Win Garano reteam to investigate a notorious Boston criminal in this sequel to At Risk. Her political career floundering, D.A. Lamont attempts to drum up some positive publicity by reopening a savage murder that stumped detectives forty years prior. Janie Brolin was killed in cold blood. Though the original investigation focused on her boyfriend, Lamont believes Janie may have actually been an uncounted victim of the Boston Strangler...
